INSERT INTO `questiontree` VALUES (1,'Venen els pares d\'un nen de 8 anys que menja molt dolços i només es renta les dents 1 cop al dia. Els seus pares han tingut moltes càries al llarg de la seva vida, tot i que el nen no té càries, els pares estan preocupats de què el seu fill en un futur en pugui tenir. Què hauríem de fer?',NULL,'Prevenció','Tractament',NULL,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis vel quam vel sem volutpat malesuada posuere ac enim. Morbi vehicula lacus neque, id condimentum mauris vestibulum in. Suspendisse pellentesque odio eget urna iaculis maximus. Pellentesque et lacinia lacus. Nam ultrices ornare dui id mollis. Nulla eget molestie tellus, at imperdiet eros. Curabitur iaculis scelerisque dolor, sit amet placerat arcu feugiat et. Aliquam porta risus eu arcu maximus dapibus. Suspendisse vel felis non mauris fermentum auctor tincidunt ac metus. Quisque enim tellus, consequat at rutrum non, eleifend non est. Quisque fermentum vestibulum leo, nec malesuada arcu aliquam sit amet.',1),(2,'Què haurem de fer per prevenir?',1,'Disminuir el consum de sucres insistir en rentar-se les dents 3 cops al dia durant 2 minuts, pasta de dents amb 1450 ppmf, ús de fil dental amb fluor, revisions periòdiques al dentista.','Disminuir el consum de sucres, realitzar segellat de fosses i fissures, aplicació de vernís, pasta de dents amb 1000 ppnf.',NULL,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis vel quam vel sem volutpat malesuada posuere ac enim. Morbi vehicula lacus neque, id condimentum mauris vestibulum in. Suspendisse pellentesque odio eget urna iaculis maximus. Pellentesque et lacinia lacus. Nam ultrices ornare dui id mollis. Nulla eget molestie tellus, at imperdiet eros. Curabitur iaculis scelerisque dolor, sit amet placerat arcu feugiat et. Aliquam porta risus eu arcu maximus dapibus.',NULL),(6,'Ve a la clínica un pacient de 10 anys perque a l’escola li han recomanat la realització d’una aplicació de fluor amb vernís